import styled from "styled-components";

const ChatButton = styled.button`

    font-family: Monteserrat-Bold;
    color: white;

    border-radius: 1.25em;
    background-color: #50B4BF;
    border: none;
    padding: 0.4375em 1.25em;
    font-size: 1em;
    line-height: 1.25em;

    margin-top: 0.5em;
    margin: 0px 0.21875em;

    transition: 0.5s;

    @:-moz-user-disabled(q)



`

export { ChatButton }
